	"character": [
		{
			"_uuid": "59a9bfdd60934b5b9c8c3f626365e006",
			"current_frame": "normal",
			"custom": true,
			"face_right": false,
			"label": "_e0bb885",
			"on_talk": "speech_dialog(self, [~Hello there.~,

				~You look magical.~, [speech_dialog(

										set(frogatto.animation, 'emote_oh'),
						   frogatto,	[~Wow. You look magical.~],
										set(self.animation, 'talk'),
						   self,		[~Uh… thanks?~],
										set(frogatto.animation, 'emote_raisedfinger'),
						   frogatto,	[~If I catch you, do you have to grant me a wish?~],
										set(self.animation, 'talk'),
						   self,		[~Did that seriously just fall out of your mouth?~],
										set(frogatto.animation, 'emote_oh'),
						   frogatto,	[~Sorry, I was just-~],
										set(self.animation, 'talk'),
						   self,		[~No, no, let's really explore this here.~],
										set(self.animation, 'talk'),
						   				[~So you think that I get bound to\\nanyone who walks up and grabs me…~],
										set(frogatto.animation, 'emote_confused'),
						   frogatto,	[~…yes…~],
										set(self.animation, 'talk'),
						   self,		[~…and I just live in this village here?\\nWith a few dozen neighbors?~],
										set(frogatto.animation, 'emote_nod'),
						   frogatto,	[~Sure, why not?~],
										set(self.animation, 'talk'),
						   self,		[~Neighbors who would never stop trying to catch me?~],
										set(frogatto.animation, 'emote_talk'),
						   frogatto,	[~I dunno. Maybe you're really fast?~],
										set(self.animation, 'talk'),
						   self,		[~Fast, and tired from always\\nneeding to look over my shoulder?~],
						   				[~Lest I get manhandled\\nby every boob who comes walking by?~],
										set(frogatto.animation, 'emote_raisedfinger'),
						   frogatto,	[~Or maybe there's a limit of one wish per person?~],
										set(self.animation, 'talk'),
						   self,		[~Okay.\\nSo you think everyone in town caught me once…~],
						   				[~…and now I can relax because\\nthey have no reason to keep trying?~],
										set(frogatto.animation, 'emote_nod'),
						   frogatto,	[~Seems plausible.~],
										set(self.animation, 'talk'),
						   self,		[~Have you seen some of\\nthe goobers that live in this area?~],
										set(self.animation, 'talk'),
						   self,		[~Did you catch that guy\\nwith the sweet new motorcycle?~],
										set(frogatto.animation, 'emote_confused'),
						   frogatto,	[~No…~],
										set(self.animation, 'talk'),
						   self,		[~Have you seen the gal\\nwith the collection of long-lost art?~],
										set(frogatto.animation, 'emote_geez'),
						   frogatto,	[~I have not.~],
										set(self.animation, 'talk'),
						   self,		[~Did Truggle tell you about their business venture\\nthat's taken the world by storm?~],
										set(frogatto.animation, 'emote_confused'),
						   frogatto,	[~Not as of yet.~],
										set(self.animation, 'talk'),
						   self,		[~Huh. It's almost as if they've\\nnever been granted any wishes before.~],
										set(frogatto.animation, 'emote_impatient'),
						   frogatto,	[~Okay, okay. I'll see myself out.~],
						)],
				~Where am I?~, [speech_dialog(
										set(frogatto.animation, 'emote_geez'),
						   frogatto,	[~I want to apologize for just <em>barging in</em>,\\nbut, uh ...~],
										set(frogatto.animation, 'emote_confused'),
						   				[~Where on earth AM I, right now?~],
										set(self.animation, 'talk'),
						   self,		[~Total stranger to the area?~],
										set(frogatto.animation, 'emote_oh'),
						   frogatto,	[~Yeah.~],
										set(self.animation, 'talk'),
						   self,		[~Well, well, then.~],
										set(self.animation, 'talk'),
						   				[~Welcome to Tempo Village.\\nEr, well, we're not <em>quite</em> in town, here…~],
										set(self.animation, 'talk'),
						   				[~…\"Outlying Area\", perhaps.\\nBut that's the town.~],
										set(frogatto.animation, 'emote_confused'),
						   frogatto,	[~Cool.~],
										set(self.animation, 'talk'),
						   self,		[~I'm rather fond of it myself.\\nCozy little place nestled into the woods here.~],
										set(self.animation, 'talk'),
						   				[~Good food.  Better people.\\nYou'll see more of it to the east.~],
										set(frogatto.animation, 'emote_nod'),
						   frogatto,	[~Nice.~],
										set(self.animation, 'talk'),
						   self,		[~You, though?  You wouldn't happen to be from\\nCrevice Village, would you?~],
										set(frogatto.animation, 'emote_talk'),
						   frogatto,	[~I am.~],
										set(self.animation, 'talk'),
						   self,		[~Oh my, we haven't have folks from that area in\\nquite a while.~],
										set(self.animation, 'talk'),
						   				[~A real pity too,\\nthere are some nice folks in that town.~],
										set(frogatto.animation, 'emote_raisedfinger'),
						   frogatto,	[~I have a notion the guy running the gate\\n<em>might</em> have something to do with it.~],
										set(frogatto.animation, 'emote_geez'),
						   				[~Kind of an old kook who might\\nbe asleep at the wheel.~],
										set(frogatto.animation, 'emote_confused'),
						   				[~The tunnel into the forest was locked,\\nand looked abandoned.~],
										set(self.animation, 'talk'),
						   self,		[~Well, now that's an interesting story.~],
										set(self.animation, 'talk'),
						   				[~It seems to check out with some rumors\\nI heard a while back.~],
										set(self.animation, 'talk'),
						   				[~Some folks tried to take the tunnel\\nhad to ring the bell, and knock on the gate.~],
										set(self.animation, 'talk'),
						   				[~Finally just had to give up.\\nNo one was answering.~],
										set(frogatto.animation, 'emote_geez'),
						   frogatto,	[~And I'm guessing from what I know -\\nI don't know of any other way around, do you?~],
										set(self.animation, 'talk'),
						   self,		[~Nope.~],
										set(frogatto.animation, 'emote_impatient'),
						   frogatto,	[~Wow.\\nI had no idea that guy was that much of a doof.~],
										set(frogatto.animation, 'emote_geez'),
						   				[~I mean, I <em>did</em>, but …\\n'benefit of the doubt', you know?~],
										set(frogatto.animation, 'emote_confused'),
						   				[~He got that job to keep him out of trouble,\\nbut I guess he's gone and made some, huh?~],
										set(self.animation, 'talk'),
						   self,		[~So it would seem, so it would seem.~],
										set(self.animation, 'talk'),
						   				[~At any rate, it's a pleasure to meet you.\\nI hope to see you around.~],
										set(frogatto.animation, 'emote_nod'),
						   frogatto,	[~All the best.~],
										set(self.animation, 'talk'),
						   self,		[~Oh! By the way, do say hello to the\\nfellow who lives near the river.~],
										set(self.animation, 'talk'),
						   				[~\"Cubeaver\".\\nHe could always use a visitor.~],
										set(frogatto.animation, 'emote_raisedfinger'),
						   frogatto,	[~Don't mind if I do!.~],
						)]						
						
				]
			) where frogatto = level.player",
